  "text" : "トリチェリが発見する（ルネサンス時代だったかな）までタンクの孔から流出する水の流速は水深に比例すると思われたし、そもそも古代ローマとかだと流量の概念そのものがなかったとか聞くし、水の流れはきちんと学ばないとなかなか発想できないのだろうなぁとは思います。 [l]",
