  "text" : "@ginie 慣性が残っているという表現でも合ってると思います。しかし、ベナコントラクタの断面収縮による拘束圧よりも、オリフィス本体の水位から受ける圧力のほうが十分に大きいので、流速はほとんど変わらないです。断面積が小さくなるので、どちらかというと流量がちょっと減ります。 [l]",
