  "text" : "@ginie 加速度の問題ではなくて、流出方向の問題ですね。孔のすぐ近くを考えてもらうと分かりやすいんですが、全てが一斉に真横に向かって流れてはいなくて、孔の境界近くは少し斜めに中心方向に向かって流れますから。 [l]",
