  "id_str" : "250046331240972288",
  "text" : "例えば流出孔の先が土で塞がれてたら、その先はダルシー則になるので、動水勾配に比例するはず。ただ、流速が大きくなって間隙水も乱流になりだすと比例しなくなるので実際どうなるかは、ぱっとは出てこない。 [l]",
