  "text" : "ふと思ったのだけど、ここで私が楽天の社長さんに「ウィキペディア日本語版管理者の青子守歌ですが、 #kobo ライセンス違反の件で・・・」って言った場合どうなるんだろう？やっぱり実名じゃないからやっぱり無視されるんですかね？それとも中の人として接してもらえるのだろうか？ #jawp",
