  "text" : "と思ったが、井戸端で問題提起して、意思表示するぐらいしか思いつかない。各利用者で「ウィキペディアの利用者の○○ですが」って送ってもいいけど、あの社長さん、実名じゃないと無視するっぽいしなぁ・・・。 #jawp",
