  "text" : "じいちゃん家でスパイっぽい人たちと隠れたり隠したりして戦ってた。その後、近くの駅から電車に乗ろうとしたらすごい混んでて電車がなぜか片輪走行で到着した。その後、もう廃止されたはずの路線まで（つながってないのに）直通運転で行って、降りたところは何故か都会。そして飛行機が落ちた。 #夢",
