  "id_str" : "245850914483748864",
  "text" : "だから所詮はこの世界においては、どれだけ正確で論理的で確実なものであっても、それを受け入れない人にとっては、どんな言葉を尽くしてもどんなものを見せたって無駄なんだろう。",
