  "text" : "@kuro16g できなくはなさそうですけどねぇ。 / 子どもは案外平気かもしれないですが、平気じゃない場合を考えると嫌、ですって。",
  "id" : 245848452502810624,
  "in_reply_to_status_id" : 245845942794854400,
  "created_at" : "Wed Sep 12 11:36:53 +0000 2012",
