  "geo" : {
  },
  "id_str" : "245143915517337602",
  "text" : "まぁあるいは、同性愛者を積極的肯定しつつ、そういう人たちは（子孫を残すという意味での）社会システムおよびヒト遺伝子の維持機構からは外し、他の部分（研究開発や教育や生産）を担ってもらう、というのでも、現実的な解かもしれないが。",
  "id" : 245143915517337602,
  "created_at" : "Mon Sep 10 12:57:18 +0000 2012",
