  "id_str" : "245140974588817409",
  "text" : "んー。国の方策として同性愛なり同性婚とかを認めるというのは、正直なところあまり良いこととは思えていない。それは単に、現在の社会システムが異性同士で子をなすことを前提にしていて子供が減ることはデメリットが大きいから。あと、ヒトの種の保存および遺伝的多様性の観点からも。",
