  "geo" : {
  },
  "id_str" : "244044460009332737",
  "text" : "色々言われてた大畠さんですが、やることはきちっとやってたんですよねぇ。こう、「人を褒めないで悪かったところばかり文句をいう」ってところがこういうところに見える。",
  "id" : 244044460009332737,
  "created_at" : "Fri Sep 07 12:08:28 +0000 2012",
